import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import HomePage from "./pages/HomePage";
import AuthPage from "./pages/AuthPage";
import PrescriptionUploadPage from "./pages/PrescriptionUploadPage";
import PharmacyAccessPage from "./pages/PharmacyAccessPage";
import MedicineVerificationPage from "./pages/MedicineVerificationPage";

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route path="/auth" element={<AuthPage />} />
        <Route path="/upload" element={<PrescriptionUploadPage />} />
        <Route path="/pharmacy" element={<PharmacyAccessPage />} />
        <Route path="/verify-medicine" element={<MedicineVerificationPage />} />

      </Routes>
    </Router>
  );
}

export default App;
